INSERT INTO `news` (`id`, `title`, `date`, `short_description`, `full_text`, `created_at`, `updated_at`, `image_path`, `views_counter`) VALUES
(2, 'В эти выходные впервые пройдет открытый Кубок студенческих команд по мини-лапте', '2024-02-24', '24 февраля пройдет церемония открытия и групповой этап соревнований, где команды поборются за выход в финал. А 25 февраля пройдут полуфинальные, финальные игры и самая приятная часть соревнований - это церемония награждения победителей и призёров.', 'Ждем спортсменов и болельщиков на базе МФСЦ \"Олимпия\" по адресу: ул. Пржевальского, 37. А все те, кто не сможет к нам присоединиться, можно будет посмотреть онлайн-трансляцию в нашей группе во ВКонтакте.\r\n\r\nНачало соревнований 24 февраля (суббота) с 9.00, церемония открытия соревнований состоится в 12.00, 25 февраля (воскресенье) соревнования продолжатся в 13.00, церемония закрытия в 17.00.\r\n\r\n#Лаптаutmnpro #Грантгубернатора72 #ТюмГУ #Фондпрезидентскихгрантов #Президетскиегранты #Лапта72 #лаптаutmn #ФЛГТ #ФедерациялаптыгородаТюмени', '2024-02-20 13:41:08', '2024-02-26 08:48:05', 'news/February2024/lbNDUGFieVQhzaoKWLQP.jpg', 20),
(3, 'Социологический опрос', '2024-03-01', 'Федерация лапты города Тюмени совместно с Тюменским государственным университетом с целью популяризации и развития национального вида спорта \"Лапта\" проводит социологический опрос на территории Тюменской области. Опрос направлен на предмет изучения отношения к виду \"Лапта\" Просьба к неравнодушным единомышленникам уделить 3-5 минут свободного времени. Заранее всех благодарим!', 'https://forms.yandex.ru/u/65da0388c417f3d3911706e0/е', '2024-03-01 06:48:31', '2024-03-01 06:48:31', 'news/March2024/gEyyWagT9kYQ6JyvYsPx.jpg', 0),
(4, 'Итоги Всероссийских соревнований по мини-лапте среди студенческих команд 2024', '2024-03-15', 'Завершились Всероссийские соревнования по мини-лапте среди студенческих команд в городе Уфе. В соревнованиях приняли участие 11 команд из Оренбургской, Воронежской, Челябинской областей и республики Башкортостан и Крыма. В том числе студенческие сборные Тюменской области.', 'Победителями и призерами стали, среди женских команд:\r\n🥇Оренбургская область,\r\n🥈Республика Башкортостан (БГПУ),\r\n🥉Сборная Тюменской области.\r\n\r\nСреди мужских команд:\r\n🥇Республика Башкортостан (БашГАУ),\r\n🥈Оренбургская область,\r\n🥉Республика Башкортостан (БГПУ).\r\n\r\nБлагодаря открытому Кубку студенческих команд Тюменской области по мини-лапте, который прошел с 25 по 26 февраля на базе Института физической культуры ТюмГУ, были сформированы сборные команды женская и мужская для участия во всероссийских соревнованиях. Всего в отборочном Кубке приняли участие 20 команд, 160 спортсменов, 20 организаторов, 20 добровольцев.\r\n\r\nЗа организацию Кубка и межведомственное взаимодействие благодарим:\r\nТюменский государственный университет;\r\nТюменскую городскую Думу в лице Осипова Дмитрия Александровича,\r\nТюменский государственный университет,\r\nТюменский индустриальный университет,\r\nТюменский колледж транспортных технологий и сервиса,\r\nТюменский техникум строительной индустрии и городского хозяйства.\r\n\r\nМы выражаем благодарность тренеру и представителю команд Фёдорову Константину Владимировичу, Мурсаловой Алёне Константиновне и Боярову Ивану Николаевичу, президенту федерации лапты города Тюмени.\r\n\r\nЗа информационное сопровождение признательны профессиональному сообществу отрасли физической культуры и спорта:\r\nДепартаменту спорта Тюменской области, Департаменту по спорту и молодежной политике Администрации г. Тюмени, АСН «Тюменской арене».\r\n\r\nПоздравляем девушек с призовым местом! Желаем всем дальнейших успехов в тренировочной и соревновательной деятельности.\r\n\r\n#Лаптаutmnpro #Грантгубернатора72 #ТюмГУ #Фондпрезидентскихгрантов #Президетскиегранты #Лапта72 #лаптаutmn #ФЛГТ #ФедерациялаптыгородаТюмени', '2024-03-20 01:13:09', '2024-03-20 01:13:09', 'news/March2024/wKmh4lJdUJledKBBQ1oC.jpg', 0);
